import React, {Component} from 'react';
import Feira from '../../components/Feira/Feira';

class Feiras extends Component {
    state = {
        nome: "teste",
        local: "locali"        
    }

    
    componentDidMount() {
        console.log(this.state);
    }

    render(){

        return(
            <div>
                <Feira feira={this.state} nome={"meu teste"}></Feira>
                <Feira></Feira>
            </div>
        );
    };
}

export default Feiras;
